eiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat.\"',NULL,1,5,1,'2020-06-02 05:27:49','2020-06-02 05:27:49'),(31,'3','1914; H. Rackham द्वारा अनुवाद','1914;-h.-rackham-द्वारा-अनुवाद','\"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.\"',NULL,1,5,1,'2020-06-02 05:28:05','2020-06-02 05:28:05'),(32,'3','Lorem Ipsum क्या है?','lorem-ipsum-क्या-है?','Lorem Ipsum छपाई और अक्षर योजन उद्योग का एक साधारण डमी पाठ है. Lorem Ipsum सन १५०० के बाद से अभी तक इस उद्योग का मानक डमी पाठ मन गया, जब एक अज्ञात मुद्रक ने नमूना लेकर एक नमूना किताब बनाई. यह न केवल पाँच सदियों से जीवित रहा बल्कि इसने इलेक्ट्रॉनिक मीडिया में छलांग लगाने के बाद भी मूलतः अपरिवर्तित रहा. यह 1960 के दशक में Letraset Lorem Ipsum अंश युक्त पत्र के रिलीज के साथ लोकप्रिय हुआ, और हाल ही में Aldus PageMaker Lorem Ipsum के संस्करणों सहित तरह डेस्कटॉप प्रकाशन सॉफ्टवेयर के साथ अधिक प्रचलित हुआ.',NULL,1,5,1,'2020-06-02 05:28:46','2020-06-02 05:28:46'),(33,'3','यह कहाँ से आता है?','यह-कहाँ-से-आता-है?','आम धारणा के विपरीत Lorem Ipsum बस यादृच्छिक (