020-06-02 05:36:17'),(50,'3','Што е Lorem Ipsum?','Што-е-lorem-ipsum?','Lorem Ipsum е едноставен модел на текст кој се користел во печатарската индустрија. Lorem ipsum бил индустриски стандард кој се користел како модел уште пред 1500 години, кога непознат печатар зел кутија со букви и ги сложил на таков начин за да направи примерок на книга. И не само што овој модел опстанал пет векови туку почнал да се користи и во електронските медиуми, кој се уште не е променет. Се популаризирал во 60-тите години на дваесеттиот век со издавањето на збирка од страни во кои се наоѓале Lorem Ipsum пасуси, а денес во софтверскиот пакет како што е Aldus PageMaker во кој се наоѓа верзија на Lorem Ipsum.',NULL,1,5,1,'2020-06-02 05:36:35','2020-06-02 05:36:35'),(51,'3','Од каде доаѓа?','Од-каде-доаѓа?','Lorem Ipsum не е случајно избран и сложен текст, спротивно од верувањата. Неговите корени потекнуваат во дела на класичната Латинска книжевност од 45-та година пред новата ера, што го прави стар преку 2000 години. Richard McClintock, професор по Латински на колеџот Hampden-Sydney во Вирџинија побарал дефиниција за малку чудните зборови \"consectetur\" од пасусите на Lorem Ipsum и додека ги анализирал деловите во класичната книжевност открил автентичен извор. Lorem Ipsum доаѓа од поглавијата 1.10.32 и 1.10.33 од книгата \"de Finibus Bonorum et Malorum\" (Крајностите на доброто и злото) кои ги напишал Cicerо во 45-та година пред новата ера. Книгата говори за теоријата на етиката, која била многу популарна во текот на ренесансата. Првата реченица на Lorem Ipsum моделот \"Lorem ipsum dolor sit amet..\", доаѓа од реченицата во поглавјето 1.10.32.',NULL,1,5,1,'2020-06-02 05:36:54','2020-06-02 05:36:54'),(52,'3','За што би го користеле?','За-што-би-го-користеле?','Познат е фактот дека вниманието на читателот ќе биде привлечено од содржината на страната која ја гледа. Поентата за користење на Lorem Ipsum е во тоа што распоредот на зборовите е речиси нормален како во обичен текст, на пример, наместо да се пишува �тука ќе има текст, тука ќе има текст� пригодно е да се вметне \"Lorem Ipsum\" текст. На ваков начин се добива еден вид на читлив текст. Многу софтверски пакети за печатење како и веб уредувачи го користат како основен модел на текст токму моделот на \"Lorem ipsum\", и доколку се изврши пребарување на интернет со \"lorem ipsum\" како како клучни зборови резултатот ќе врати многу веб сајтови кои се на некој начин во финална изработка. Во текот на годините се развивале различни верзии, некогаш како случајност, а некогаш со одредена цел.',NULL,1,5,1,'2020-06-02 05:37:12','2020-06-02 05:37:12'),(53,'3','Каде можам да го набавам?','Каде-можам-да-го-набавам','Постојат многу варијации на пасуси од Lorem Ipsum, меѓутоа повеќето претрпеле одредени промени, некои со додавање на одредена доза на хумор, додека некои со случано подредување на зборовите коишто воопшто не звучат веројатно. Доколку планирате да ги користите пасусите на моделот на Lorem Ipsum , треба да се осигурате дека во содржината на текстот не се крие некоја скриена непријатна порака. Сите генератори на Lorem Ipsum кои се наоѓаат на Интернет се направени да повторуваат претходно дефинирани зборови. Тоа го овој гeнератор на Lorem Ipsum пасуси прв вистински генератор достапен на Интернет. Користи речник од околу 200 латински зборови кои се комбинирани со многу различни шаблони на реченици со цел да се исгенерира Lorem Ipsum текст кој изгледа соодветно. Тоа значи дека текстот од Lorem Ipsum пасуси којшто е исгенериран овде не содржи повторувања на зборови, нема уфрлено некој хумор или некои неочекувани и непосакувани зборови итн.',NULL,19,5,1,'2020-06-02 05:37:28','2020-06-19 06:18:39'),(54,'2','ttl','ttl','des',NULL,51,5,1,'2020-06-03 01:41:30','2020-06-18 17:25:56'),(66,'1','mmmmmmm','ffffffffffff',NULL,'sdffdf',5,1,1,'2020-06-13 09:57:06','2020-06-16 03:57:19'),(74,'1','website development','website development',NULL,'<p>but because those who do not know how to pursue pleasure rationally encoun